//import { authRoles } from 'app/auth';
import i18next from 'i18next';
import en from './navigation-i18n/en';
i18next.addResourceBundle('en', 'navigation', en);
const navigationConfig = [
	{
		id: 'applications',
		title: 'Applications',
		translate: 'PRINCIPAL',
		type: 'group',
		icon: 'apps',
		url: '/apps/empresa',
		children: [
			{
				id: 'dashboards',
				title: 'Dashboards',
				url: '/apps/empresa',
				type: 'item',
				icon: 'dashboard',
				children: [
					{
						id: 'analytics-dashboard',
						title: 'Analytics',
						type: 'item',
						url: '/apps/dashboards/analytics'
					},
					{
						id: 'project-dashboard',
						title: 'Project',
						type: 'item',
						url: '/apps/dashboards/project'
					}
				]
			},

		]
	},
	{
		id: 'calendar',
		title: 'Calendar',
		translate: 'CALENDAR',
		type: 'item',
		icon: 'today',
		url: '/apps/calendar'
	},
];

export default navigationConfig;
